#Turn our text into images for viewing
def create_text_image(text, width, height, font_path, font_size, cover=False, cover_text=False, cover_font_path=None):
    if cover:
        # Load the background image for the cover
        img = Image.open('static/images/story_cover_image.png').convert('RGB')
        img = img.resize((width, height), Image.ANTIALIAS)
        if cover_font_path is not None:  # If a cover font is specified, use it
            font_path = cover_font_path
    else:
        # Load the background image for the story pages
        img = Image.open('static/images/story_page_image.png').convert('RGB')
        img = img.resize((width, height), Image.ANTIALIAS)

    draw = ImageDraw.Draw(img)
    font = ImageFont.truetype(font_path, font_size)

    if cover_text:
        wrapped_text = '\n'.join(wrap(text, width=15))  # Adjust the width as needed for the cover text
    else:
        wrapped_text = '\n'.join(wrap(text, width=30))  # Adjust the width as needed for the story pages

    text_width, text_height = draw.textsize(wrapped_text, font)
    draw.text(((width - text_width) // 2, (height - text_height) // 2), wrapped_text, font=font, fill=(0, 0, 0))

    # Return image data as bytes
    img_byte_arr = io.BytesIO()
    img.save(img_byte_arr, format='PNG')
    img_byte_arr = img_byte_arr.getvalue()
    return img_byte_arr

